import React, { useState } from 'react'
import { Link } from 'react-router-dom';
import { NavTopics } from './NavTopics';

const Navbaar = ()=>{ 

    const navItems = NavTopics.map(
        (i)=>{
            return <div className={i.DSlass}>
                <Link to={i.path} style={{textDecoration:'none'}}>
                    <div className={i.DSlass}>
                        <span className="text-weight-bold">{i.label}</span>
                    </div>
                </Link>
            </div>
        }
    )

    return (
        <div>
            <nav className="nav nav-tabs navbar navbar-expand bg-">
            {navItems}
            </nav>
        </div>
            ) 

}

export default Navbaar;
